@jaredmeesracing takes the win at race II of the @americanflattrack New York Short Track doubleheader.

Next Saturday, TT racing returns from Peoria as the championship tightens with just six races to go. Mees looks to keep the streak going as he chips away at @briarbauman's 22 point championship lead.

